// Define custom texts
const customText1 = ` Eто го плана. Ще изчакаме войната между русия и германия да се разгорещи и атакуваме германия. След побеждаване то на германия ще нападнем и заслабналата русия и нйкои няма да ни се опре. Германия, управлявана от Преслав Екстремиста, и Русия, под властта на Владимир Путин, са в разгара на изключително жестока и опустошителна влакова война. Двете суперсили са се впуснали в отчаяна битка за територия и влияние, използвайки най-мощните си технологии и оръжия, включително гигантски влакове, снабдени с оръжия за масово унищожение.

Разделянето на Световете
Преслав, лидер на Германия, е създал нова генерация влакове, включително новия Редстоун Влак V2, който е оборудван със смертоносни лазери и мега-бомби, способни да разрушават цели градове. Той планира да използва този гигантски съвършен механизъм, за да надвие Путин в решителната битка. За Русия, Путин разчита на нещо не по-малко страховито: Летящия Тухлен Влак, създаден за да носи мощни ракетни установки и уникална броня, която да издържа на всяка атака.

Споразумението за Съдбата на Войната
Въпреки тежката война, и двете сили разбират, че продължаването на конфликта ще унищожи всичко, което са изградили през годините. След интензивни преговори, те постигат неочаквано споразумение да прекратят войната на територията на Германия, със силата на техните най-мощни оръжия – готови да се сблъскат за последен път.

Финалният Конфликт
Докато Путин пристига с Летящия Тухлен Влак в германските земи, той знае, че няма да му е лесно. Преслав го очаква, като се готви да го посрещне с Редстоун Влак V2, който вече е в движение и приготвен за атака. Когато двата влака се срещат на границата на Германия, конфликтът изглежда неизбежен.

Но точно в този момент, както обикновено, се намесва трети фактор – Добчо Механикс. Той, решен да помогне на Путин и да сложи край на войната, решава да използва своя собствено конструиран Лада Влак. Обединявайки силите си с Путин, Добчо напада Редстоун Влак V2, със своите уникални маневри и технологии, преодолявайки защитите на Преслав и нанасяйки сериозни щети на вражеския влак.

Появата на Влакодовището
Когато изглежда, че победата на Путин и Добчо е в ръцете им, нещо неочаквано се случва. От далечината се чува страшен вик, който разтърсва небето. На хоризонта се появява нещо, което изглежда като чудовищен влак – това е Влакодовището, легендарният влак, за който се говори само в митове и легенди. С бързи и неочаквани маневри, Влакодовището атакува Летящия Тухлен Влак на Путин, сваляйки го на земята със своето невероятно разрушително оръжие.

От Влакодовището излиза самият Стънката – терористът и лидер на групата "Стъките", добре известен с ужасните си технологични изобретения и безпощадност. С присъствието си, той излъчва не само сила, но и непредсказуемост. Добчо, който все още се бори с Лада Влак, решава да опита да се бори със Стънката, опитвайки се да направи маневра, която да го изведе обратно в битката.

Трансформацията на Добчо
Докато Добчо се опитва да върне Лада Влак към Стънката, той среща съпротива. Стънката, с присъщата си хладнокръвност, изважда Том Играчката Разлушител, легендарното устройство, което генерира разрушителни звукови вълни и може да порази всеки влак на място. С една бърза атака, той унищожава Лада Влак, оставяйки Добчо и неговите съюзници без защита.

Ново Альянс
Преслав, виждайки как нещата се влошават, решава да се обърне към Стънката за помощ. Той предлага съюз срещу Путин и Добчо, вярвайки, че само с такъв съюз могат да побеждат. Но Стънката не е човек, който да се довери лесно. Използвайки Влакодовището, той хвърля Преслав на бойното поле при Путин и Добчо, предизвиквайки го да се бори за собственото си оцеляване.

Предсказания и Рушащи се Светове
Със смъртоносния конфликт в разгара си, Стънката произнася мрачно предсказание: "Това не е началото на края на света, който познавате, а края на началото."`;
