// Function to type out text with a slow typing effect
function typeText(text, speed, callback) {
  let charIndex = 0;
  function typeNextCharacter() {
      if (charIndex < text.length) {
          output.innerHTML += text[charIndex];
          charIndex++;
          setTimeout(typeNextCharacter, speed);
      } else {
          if (callback) callback(); // Call the callback after typing is complete
      }
  }
  typeNextCharacter();
}

